const Direct = () => {
    const Atm = () => {
        const Date = new Date()

        return (
            Date.toLocaleDateString()
        )
    }
    return(
        <Fragment>
            <div className="actu_concert">Actuellement en concert</div>
            {Atm()}
        </Fragment>
    )
}

